import L from 'leaflet'

export const Airplanes = L.icon({
    iconUrl: require('../assets/logo.svg'),

    iconRetinaUrl: require('../assets/logo.svg'),
    iconAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: [35, 35],
    className: 'leaflet-venue-icon',
}); 

/* export default Airplanes */
